import React from "react";
import {useState} from  'react'

function Square() {

  const[value, setValue] = useState("Orale vato!");

  function handleClick()  {
    console.log('clicked! Button #'+value)
  }
  return (
    <button 
      className="square"
      onClick={handleClick}
    >
      {value}
    </button>)
}

export default function Board() {
  return (
  <>
    {/* button is a JSX element */}
    <div className="board-row">
      <Square value="1"/>
      <Square value="2"/>
      <Square value="3"/>
    </div>
    <div className="board-row">
      <Square value="4"/>
      <Square value="5"/>
      <Square value="6"/>
    </div>
    <div className="board-row">
      <Square value="7"/>
      <Square value="8"/>
      <Square value="9"/>
    </div>
  </>
  );
}
